steps.onInit:
scenario.question = scenario.scenarioArgs.question;
scenario.profile = scenario.scenarioArgs.profile;
scenario.questionsNum = scenario.scenarioArgs.questionsNum;
scenario.dontKnowRegex = "[D,d]on[',']?t [K,k]now|[N,n]ot [S,s]ure|[D,d]on[',']?t [W,w]ant [T,t]o [A,a]nswer";
session.trace("skfldjdsaljlsdsda" ,1)

if (scenario.response.entity === "Yes") {
    scenario.response = "true";
} else if (scenario.response.entity === "No") {
    scenario.response = "false";
} else {
    scenario.response = null;
}

if (scenario.response && new RegExp(scenario.dontKnowRegex).test(scenario.response)) {
    scenario.response = null;
}

if (new RegExp(scenario.dontKnowRegex).test(scenario.responseNum)) {
    scenario.num = null;
} else {
    scenario.num = parseFloat(scenario.responseNum);
}

if (scenario.num != null) {
    scenario.response = scenario.num.toString();
} else {
    scenario.response = null;
}

// if has question by entity type
if (scenario.languageJson.entityTypes[scenario.question.ayalonEntityType] != null) {
    scenario.questionText = scenario.languageJson.entityTypes[scenario.question.ayalonEntityType].question;
} else if(scenario.languageJson.allowedConcepts[scenario.question.umlsConceptId] != null) {
    // has question by concept
    let conept = scenario.languageJson.allowedConcepts[scenario.question.umlsConceptId];
    scenario.questionText = conept.question;
    scenario.question.ayalonEntityText = conept.name;
    scenario.choices = conept.choices;
    scenario.multiChoice = conept.multiChoice;
} else {
    // got concept id without a valid question mapped to it
    scenario.questionText = scenario.question.umlsConceptId + "?"
}

scenario.questionText = scenario.questionText.replace("%p1%", scenario.question.ayalonEntityText);

var userQuestion = {};
userQuestion.question = scenario.concept;
userQuestion.questionText = scenario.questionText;
userQuestion.profile = scenario.profile;
userQuestion.questionsNum = scenario.questionsNum;
session.logCustomEvent('USER_QUESTION', userQuestion);

scenario.cardChoices = []
for (const code in scenario.multiChoice) {
  scenario.multiChoice[code].code = code
  scenario.cardChoices.push({
        title: scenario.multiChoice[code].name,
        value: code
      })
}

if (typeof scenario.response === "string" && new RegExp(scenario.dontKnowRegex).test(scenario.response)) {
    scenario.response = null;
}

let resultSet = null;
let dontKnow = false;
// the response is null only when user answers "don't know"
if(scenario.response == null){
    dontKnow = true;
}else{
    resultSet = new Set(scenario.response.choices?.split(",") || []);
}

scenario.result = scenario.cardChoices.map(r=>
({
    code: r.value,
    answer: dontKnow ? null:(resultSet.has(r.value) ? "True" : "False"),
    answerType: "Boolean",
    ayalonEntityText: r.title,
    ayalonEntityType: scenario.question.ayalonEntityType
}))

scenario.timeStarted = new Date().getTime();
scenario.totalQuestionsAsked = 0;
scenario.luis = {};
// temp variables for normalization
var locationCity = null;
var locationCountry = null;
var locationState = null;
var ageResolution = null;
var condition = null;
// for research and improving language model
var notMappedEntities = [];
// conversation started with arguments
if(scenario.scenarioArgs.entities != null) {
    // iterate all LUIS entities and set their values
    scenario.scenarioArgs.entities.forEach(ent => {
        switch(ent.type) {
            case "gender":
                scenario.luis.gender = ent.role;
                break;
            case "builtin.age":
                ageResolution = ent.resolution;
                break;
            case "disease":
                condition = ent.entity;
                break;
            case "builtin.geographyV2.countryRegion":
                locationCountry = ent.entity;
                break;
            case "builtin.geographyV2.state":
                locationState = ent.entity;
                break;
            case "builtin.geographyV2.city":
                locationCity = ent.entity;
                break;
            default:
                notMappedEntities.push(ent.entity);
        }
    });
}
// condition normalization
if (condition != null) {
    // replace " - " with "-" for luis model entity repair
    scenario.luis.condition = condition.replace(" - ", "-");
}
// age normalization
if (ageResolution != null) {
    switch (ageResolution.unit) {
        case "Year":
            scenario.luis.age = ageResolution.value;
            break;
        case "Month":
            scenario.luis.age = (+ageResolution.value / 12) + "";
            break;
        case "Week":
            scenario.luis.age = (+ageResolution.value / 52) + "";
            break;
        case "Day":
            scenario.luis.age = (+ageResolution.value / 365) + "";
            break;
        default:
            scenario.luis.age = null;        
    }
}
// location normalization
if(locationCountry != null || locationState != null || locationCity != null) {
    scenario.luis.location = {};
    if(locationCountry != null) {
        scenario.luis.location.country = locationCountry;
    }
    if(locationState != null) {
        scenario.luis.location.state = locationState;
    }
    if(locationCity != null) {
        scenario.luis.location.city = locationCity;
    }
};

scenario.consts = scenario.initScenarioResponse.consts;
// add explicit log
scenario.consts.TRIALS_LOG_LIMIT = 100;

scenario.profile = scenario.initScenarioResponse.userProfile;

// initialize askedCodes
scenario.profile.askedCodes = [];

// initialize qeRequest
var qeRequest = {};
qeRequest.id = new Date().getTime().toString();
qeRequest.profile = scenario.profile;
scenario.qeRequest = qeRequest;
scenario.qeRequest.expandCondition = true;

scenario.trials = scenario.qeResponse.trials;
scenario.trialsCountPrev = scenario.trials.length;
scenario.qeTrials = scenario.trials;

var trialIds = scenario.trials.map(trial => trial.nctId);

scenario.disqualifyRequest = {
    trialIds,
    profile: scenario.profile
};

// keeping track for total questions
scenario.totalQuestionsAsked++;

var criterion = scenario.disqualifyResponse.criteria[scenario.questionIndex];
scenario.questionArgs = {};
scenario.questionArgs.question = criterion;
scenario.questionArgs.profile = scenario.profile;
scenario.questionArgs.questionsNum = scenario.totalQuestionsAsked;

// update scenario.trialsCountPrev and scenario.trials
scenario.trialsCountPrev = scenario.trials.length;
scenario.trials = scenario.disqualifyResponse.trials;

var qeResponse = {};
qeResponse.trials = scenario.trials.slice(0, scenario.consts.TRIALS_LOG_LIMIT).map(trial => {
    return {
        "nctId": trial.nctId
    };
});
qeResponse.qeTrialsNum = scenario.trials.length;
session.logCustomEvent('QE_RESPONSE', qeResponse);

var trialResults = {};
trialResults.totalQuestions = scenario.totalQuestionsAsked;
trialResults.resultTrialsNum = scenario.trials.length;
trialResults.qeTrialsNum = scenario.qeTrials.length;
trialResults.resultTrials = scenario.trials.slice(0, scenario.consts.TRIALS_LOG_LIMIT).map(trial => {
    return {
        "nctId": trial.nctId,
        "sponsor": trial.leadSponsor
    };
});
trialResults.secondsSpent = (new Date().getTime() - scenario.timeStarted) / 1000;
trialResults.profile = scenario.profile;
session.logCustomEvent('TRIALS_RESULTS', trialResults);

var continueAskingExtended = {};
continueAskingExtended.entity = scenario.continueAsking.entity;
continueAskingExtended.trialsNum = scenario.trials.length;
session.logCustomEvent('USER_CONTINUE_ASKING_RESPONSE', continueAskingExtended);

scenario.questionGenerationResponse.forEach(answer=>{
var userAnswer = {};
userAnswer.questionsNum = scenario.totalQuestionsAsked;
userAnswer.answer = answer;
userAnswer.profile = scenario.profile;
session.logCustomEvent('USER_ANSWER', userAnswer);
});

var disqualifyResponseExtended = {};
disqualifyResponseExtended.userAnswer = scenario.questionAnswer;
disqualifyResponseExtended.disqualifiedTrialsNum = scenario.trialsCountPrev - scenario.trials.length;
disqualifyResponseExtended.questionsNum = scenario.totalQuestionsAsked;
session.logCustomEvent('DISQUALIFY_RESPONSE', disqualifyResponseExtended);

scenario.luis = scenario.scenarioArgs.luis;

scenario.consts = {};
scenario.consts.TRIALS_THRESHOLD = 5;
scenario.consts.QUESTIONS_THRESHOLD = 5;
scenario.consts.MIN_AGE = 0;
scenario.consts.MAX_AGE = 120;

var userProfile = {};
// gender 
if (scenario.luis.gender != null) {
    userProfile.gender = scenario.luis.gender;
} else {
    if (scenario.genderValue.entity !== "Prefer not to say") {
        userProfile.gender = scenario.genderValue.entity.toLowerCase();
    }
}
// age
if (scenario.luis.age != null) {
    userProfile.age = scenario.luis.age;
} else {
    userProfile.age = scenario.ageValue + "";
}
// condition
if (scenario.luis.condition != null) {
    userProfile.condition = scenario.luis.condition;
} else {
    userProfile.condition = scenario.conditionValue;
}
// location
if (scenario.luis.location != null) {
    userProfile.searchLocationCountry = scenario.luis.location.country;
    userProfile.searchLocationState = scenario.luis.location.state;
    userProfile.searchLocationCity = scenario.luis.location.city;
} else {
    userProfile.searchLocationCountry = scenario.countryValue != null ? scenario.countryValue : null;
    userProfile.searchLocationState = scenario.stateValue != null ? scenario.stateValue : null;
    userProfile.searchLocationCity = scenario.cityValue != null ? scenario.cityValue : null;
}
// assign values to scenario
scenario.userProfile = userProfile;

steps.returnValue:
{
    consts: scenario.consts,
    messages: scenario.messages,
    questions: scenario.questions,
    userProfile: scenario.userProfile,
}

steps.onInit:
var cardBody = scenario.trials.map(trial => {
    return {
		"type": "Container",
		"separator": true,
		"spacing": "Large",
		"items": [
            {
                "type": "TextBlock",
                "text": "RECRUITING",
                "separator": true,
                "color": "dark"
            },{
                "type": "TextBlock",
                "color": "accent",
                "text": "[" + trial.briefTitle + "](https://clinicaltrials.gov/ct2/show/" + trial.nctId + ")",
                "spacing": "none",
                "wrap": true,
                "color": "blue"
            },{
                "type": "TextBlock",
                "text": "Clinical trial ID: " + trial.nctId,
                "isSubtle": true,
                "weight": "lighter"
            }
        ]
    }
});

scenario.card = {
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "type": "AdaptiveCard",
  "version": "1.0",
  "body": cardBody
};
